novaScreenPlay = ScreenPlay:new {
	numberOfActs = 1,
	screenplayName = "novaScreenPlay"
}

registerScreenPlay("novaScreenPlay", true)

function novaScreenPlay:start()
	if (isZoneEnabled("space_corellia")) then
		self:spawnSceneObjects()
		self:spawnMobiles()
	end
end

